import React from 'react';
import Header from '../header';
import styles from './NotFoundBlock.module.scss'

console.log(styles)

export const NotFoundBlock = () => {
    return (
        <>
        <Header />
            <h1 className={styles.root}>
                <span>
                    Nothing Found :\
                </span>
            </h1>
        <Footer />
        </>
    )
}

export default NotFoundBlock;
